import React from 'react';
import './Functions.css';

export default function Functions () {
    return (
        <div className='Home__Functions'>
            <div className='Home__Functions--title'>
                <div>Choose game</div>
                <div>Gather players</div>
                <div>Fix place and date</div>
                <div>Reserve table</div>
            </div>
            <div className='Home__Functions--description'>
                <div>Pick type and title</div>
                <div>Pick number and level of players</div>
                <div>Decide where and when to play</div>
                <div>Book room for your game</div>
            </div>
        </div>
    );
};
